import React from 'react';
import Title from './Header.js';
import Body from './Body.js';
import './grids.css';

function App() {
  return (
    <div className='ninegrid'>
      <div id='title'>
        <Title />
      </div>
      <div id='pitch'>
        <Pitch />
      </div>
      <div id='navside'>
        <Body  />
      </div>
    </div>
  )
}

export default App;
